import React from "react";
import "../App.css";
import { SidebarData } from "./SidebarData";

export default function Sidebar() {
  return (
    <div className="Sidebar">
      <ul>
        {SidebarData.map((val, key) => {
          return (
            <li key={key} onClick={(window.loc)}>
              <div>{val.icon}</div>
              {""}
              <div>{val.title}</div>
            </li>
          );
        })}
      </ul>
    </div>
  );
}
